import React from 'react';
import AppLayout from '../components/AppLayout';
import LolPostList from '../components/LolPostList';


const data = [
    {
        title: 'Title 1',
        contnet: '1',
    },
    {
        title: 'Title 2',
        contnet: '2',
    },
    {
        title: 'Title 3',
        contnet: '3',
    },
    {
        title: 'Title 4',
        content: '4',
    },
];

const Home = () => {
    return (
        <AppLayout>
            <LolPostList data={data}></LolPostList>
        </AppLayout>

    );

};


export default Home;
